The following snippet can be used to run code after the initialization of the WebAssembly application: <script type="module"> addEventListener("TrunkApplicationStarted", (event) => { console.log("application started - bindings:", window.wasmBindings, "WASM:", event.detail.wasm); // wasm_ffi is a function exported from WASM to JavaScript window.wasmBindings.wasm_ffi(); // You can also run this via the WASM instance in the details // event.detail.wasm.wasm_ffi();
});
</script> Also see the vanilla example: https://github.com/trunk-rs/trunk/tree/main/examples/vanilla .

